# B Model Details 

For a given topology (i.e. a set of bonded pairs), an oxDNA configuration of $n$ nucleotides is represented in a space-fixed frame by the center of masses of each nucleotide, $\mathbf{R} \in \mathbb{R}^{n \times 3}$, and the orientations of each particle represented by a quaternion, $\mathbf{Q} \in \mathbb{R}^{n \times 4}$. For a given nucleotide, a local reference frame can also be defined with basis vectors $\mathbf{a}_{1}$ (a vector directed from the backbone site to the base site), $\mathbf{a}_{2}$ (a vector normal to the plane of the base), and $\mathbf{a}_{3}$ $\left(\mathbf{a}_{3}=\mathbf{a}_{1} \times \mathbf{a}_{2}\right)$. For the $i^{\text {th }}$ nucleotide with orientation described by $\mathbf{q}=\mathbf{Q}_{\mathbf{i}} \in \mathbb{R}^{4}$, the local nucleotide reference frame can be computed as:

$$
\begin{aligned}
& a_{1}=\left[q_{0}^{2}+q_{1}^{2}-q_{2}^{2}-q_{3}^{2}, \quad 2\left(q_{1} q_{2}+q_{0} q_{3}\right), \quad 2\left(q_{1} q_{3}-q_{0} q_{2}\right)\right] \\
& a_{2}=\left[2\left(q_{1} q_{2}-q_{0} q_{3}\right), \quad q_{0}^{2}-q_{1}^{2}+q_{2}^{2}-q_{3}^{2}, \quad 2\left(q_{2} q_{3}+q_{0} q_{1}\right)\right] \\
& a_{3}=\left[2\left(q_{1} q_{3}+q_{0} q_{2}\right), \quad 2\left(q_{2} q_{3}-q_{0} q_{1}\right), \quad q_{0}^{2}-q_{1}^{2}-q_{2}^{2}+q_{3}^{2}\right]
\end{aligned}
$$

In oxDNA, a nucleotide has three interaction sites used in the energy calculation: a backbone repulsion site, a stacking site, and a hydrogen bonding site. For a particular nucleotide with centre of mass $\mathbf{r}=\mathbf{R}_{\mathbf{i}} \in \mathbb{R}^{3}$, the locations of these interaction sites in the space-fixed frame are given by:

$$
\begin{aligned}
\mathbf{r}_{\text {back }} & =\mathbf{r}+d_{1, \text { back }} \mathbf{a}_{1}+d_{2, \text { back }} \mathbf{a}_{2}+d_{3, \text { back }} \mathbf{a}_{3} \\
\mathbf{r}_{\text {stack }} & =\mathbf{r}+d_{1, \text { stack }} \mathbf{a}_{1}+d_{2, \text { stack }} \mathbf{a}_{2}+d_{3, \text { stack }} \mathbf{a}_{3} \\
\mathbf{r}_{\text {hb }} & =\mathbf{r}+d_{1, \text { bb }} \mathbf{a}_{1}+d_{2, \text { bb }} \mathbf{a}_{2}+d_{3, \text { bb }} \mathbf{a}_{3}
\end{aligned}
$$

where vectors $\mathbf{d}_{\mathbf{X}}=\left(\mathrm{d}_{1, X}, \mathrm{~d}_{2, X}, \mathrm{~d}_{3, X}\right)$ are displacements from the nucleotide centre-of-mass to interaction sites $X$ in the local nucleotide frame; these are model-specific parameters controlling relative placement of interaction sites. The values of $\mathbf{d}_{\mathbf{X}}$ are as follows:

$$
\begin{aligned}
\mathbf{d}_{\text {back }}^{1} & =\left[\begin{array}{lll}
-0.4, & 0.0, & 0.0
\end{array}\right] \\
\mathbf{d}_{\text {back }}^{2} & =\left[\begin{array}{lll}
-0.34, & 0.3408, & 0.0
\end{array}\right] \\
\mathbf{d}_{\text {stack }} & =\left[\begin{array}{lll}
0.34, & 0.0, & 0.0
\end{array}\right] \\
\mathbf{d}_{\text {hb }} & =\left[\begin{array}{lll}
0.4, & 0.0, & 0.0
\end{array}\right]
\end{aligned}
$$

where $\mathbf{d}_{\text {back }}^{1}$ and $\mathbf{d}_{\text {back }}^{2}$ are the displacement vectors for the backbone site in oxDNA1 and oxDNA2, respectively. In oxDNA2 (and oxRNA), several additional "ghost" sites are used in energy subterms (e.g. stacking) that do not have excluded volume; see Refs. [26] and [23] for details.
An oxDNA (or oxRNA) energy function is a function that maps a collection of center of masses $\mathbf{R} \in \mathbb{R}^{n \times 3}$, and orientations $\mathbf{Q} \in \mathbb{R}^{n \times 4}$ to a scalar - it is the role of the energy function to determine the position of interaction sites. Thus, the parameters describing the relative position of the interaction sites can be thought of as parameters of the energy function that can be optimized via our method just as the parameters describing angular and radial terms. Our method could naturally be used to optimize these parameters though we present no such experiments in this work.
